import React from 'react';

function CircleProgressBarBase() {
  const circleConfig = {
    viewBox: '0 0 38 38',
    x: '19',
    y: '19',
    radio: '15.91549430918954',
  };

  return (
    <figure>
      <svg viewBox={circleConfig.viewBox}>
        <circle
          className="ring"
          cx={circleConfig.x}
          cy={circleConfig.y}
          r={circleConfig.radio}
          fill="transparent"
          stroke="gray"
        />

        <circle
          className="path"
          cx={circleConfig.x}
          cy={circleConfig.y}
          r={circleConfig.radio}
          fill="transparent"
          stroke="teal"
          strokeDasharray="75 25"
          strokeDashoffset="25"
        />
      </svg>

      <g className="circle-label">
        <text x="50%" y="50%" className="circle-percentage">
          75%
        </text>
        <text x="50%" y="50%" className="circle-text">
          COMPLETE
        </text>
      </g>
    </figure>
  );
}

export default CircleProgressBarBase;
